let hamming_dist text1 text2 =
  let rec loop i ham_dist =
    if String.length text1 < i + 1
    then ham_dist
    else if Char.(text1.[i] = text2.[i])
    then loop (i + 1) ham_dist
    else loop (i + 1) (ham_dist + 1)
  in
  loop 0 0
;;

let check list text pattern d i =
  if hamming_dist (String.sub text ~pos:i ~len:(String.length pattern)) pattern
     <= d
  then i :: list
  else list
;;

let main pattern text d =
  let rec loop list i =
    if i > String.length text - String.length pattern - 1
    then List.rev list
    else loop (check list text pattern d i) (i + 1)
  in
  loop [] 0
;;

